# Supplementary Material: Improving Genomic Prediction using High-dimensional Secondary Phenotypes: the Genetic Latent Factor Approach
## S.1. GENOMIC PREDICTION

We more or less follow the notation of Runcie and Cheng [S9] and Arouisse et al. [S2]. Let $\mathbf{Y} \in$ $\mathbb{R}^{n \times(p+1)}$ be the data matrix containing unreplicated, mean-centered, and scaled measurements on $p$ secondary features and the focal trait for $n$ genotypes. We can divide the $n$ genotypes into a test and training set so that $n=n_{t}+n_{o}$ ( $t$ for test and $o$ for the observed training set). The matrix $\mathbf{Y}$ can then be partitioned as:

$$
\mathbf{Y}=\left[\begin{array}{ll}
\mathbf{Y}_{s t} & \mathbf{y}_{f t} \\
\mathbf{Y}_{s o} & \mathbf{y}_{f o}
\end{array}\right]=\left[\begin{array}{l}
\mathbf{Y}_{. t} \\
\mathbf{Y}_{. o}
\end{array}\right]
$$

where $\mathbf{Y}_{s t}$ and $\mathbf{Y}_{s o}$ ( $s$ for secondary) are the sub-matrices containing the HTP features for the test and training set, respectively. Similarly, $\mathbf{y}_{f t}$ and $\mathbf{y}_{f o}$ ( $f$ for focal) are the column vectors containing the focal trait for the test and training set.

The measurements in the data matrix $\mathbf{Y}$ are composed of genetic effects, residual effects, and possibly covariates so that $\mathbf{Y}=\mathbf{X} \boldsymbol{\beta}+\mathbf{G}+\mathbf{E}$. The random matrices for the genetic and residual effects come from matrix normal distributions:

$$
\begin{aligned}
& \mathbf{G} \sim \mathcal{M N}_{n, p+1}\left(\mathbf{0}, \mathbf{K}, \boldsymbol{\Sigma}^{g}\right) \\
& \mathbf{E} \sim \mathcal{M N}_{n, p+1}\left(\mathbf{0}, \mathbf{I}_{n}, \boldsymbol{\Sigma}^{\epsilon}\right)
\end{aligned}
$$

where the row-covariances are the kinship matrix $\mathbf{K}$ and the identity matrix $\mathbf{I}_{n}$ for the genetic and residual effects. The column-covariances are the genetic and residual covariance matrices of the secondary features and focal trait. Assuming that $\mathbf{Y}$ is only composed of genetic and residual effects, a standard result shows that the column-wise vectorization of $\mathbf{Y}$, denoted as $\operatorname{vec}(\mathbf{Y})$, follows a multivariate normal distribution:

$$
\operatorname{vec}(\mathbf{Y})=\operatorname{vec}(\mathbf{G})+\operatorname{vec}(\mathbf{E}) \sim \mathcal{N}_{n(p+1)}\left(\mathbf{0}, \boldsymbol{\Sigma}^{g} \otimes \mathbf{K}+\boldsymbol{\Sigma}^{\epsilon} \otimes \mathbf{I}_{n}\right)
$$

where $\otimes$ denotes the Kronecker product. Similarly to the data matrix itself, we can partition the kinship and covariance matrices as well:

$$
\mathbf{K}=\left[\begin{array}{ll}
\mathbf{K}_{t t} & \mathbf{K}_{t o} \\
\mathbf{K}_{o t} & \mathbf{K}_{o o}
\end{array}\right]
$$

where $\mathbf{K}_{t t}$ and $\mathbf{K}_{o o}$ contain the genetic relatedness coefficients within the test and training sets, respectively. The genetic relatedness coefficients between test and training genotypes are given by $\mathbf{K}_{t o}=\left(\mathbf{K}_{o t}\right)^{\top}$. Furthermore,

$$
\begin{aligned}
\boldsymbol{\Sigma}^{g} & =\left[\begin{array}{ll}
\boldsymbol{\Sigma}_{s s}^{g} & \boldsymbol{\sigma}_{s f}^{g} \\
\boldsymbol{\sigma}_{f s}^{g} & \sigma_{f f}^{g}
\end{array}\right]=\left[\begin{array}{l}
\boldsymbol{\sigma}_{g}^{g} \\
\boldsymbol{\sigma}_{f}^{g}
\end{array}\right] \\
\boldsymbol{\Sigma}^{\epsilon} & =\left[\begin{array}{ll}
\boldsymbol{\Sigma}_{s s}^{\epsilon} & \boldsymbol{\sigma}_{s f}^{\epsilon} \\
\boldsymbol{\sigma}_{f s}^{\epsilon} & \sigma_{f f}^{\epsilon}
\end{array}\right]=\left[\begin{array}{l}
\boldsymbol{\sigma}_{s}^{\epsilon} \\
\boldsymbol{\sigma}_{f}^{\epsilon}
\end{array}\right]
\end{aligned}
$$

where $\boldsymbol{\Sigma}_{s s}^{g}$ and $\boldsymbol{\Sigma}_{s s}^{\epsilon}$ contain the genetic and residual covariances among secondary features, $\sigma_{f f}^{g}$ and $\sigma_{f f}^{\epsilon}$ are the scalar focal trait genetic and residual variances, and $\boldsymbol{\sigma}_{s f}^{g}=\left(\boldsymbol{\sigma}_{f s}^{g}\right)^{\top}$ and $\boldsymbol{\sigma}_{s f}^{\epsilon}=\left(\boldsymbol{\sigma}_{f s}^{\epsilon}\right)^{\top}$ contain the genetic and residual covariances between secondary features and the focal trait.

As mentioned above, there are generally speaking three genomic prediction scenarios depending on whether secondary data is available for just the training set (CV1), both training and test set (CV2), or not at all (univariate genomic prediction). We now review the expressions for the training $\left(\mathbf{G}_{o}\right)$ and test set $\left(\mathbf{G}_{t}\right)$ BLUPs in these three scenarios.

In the univariate scenario, we only use information on the focal trait of the training set $\left(\mathbf{y}_{f o}\right)$ to obtain predictions for the test set:

$$
\begin{aligned}
\hat{\mathbf{V}} & =\hat{\sigma}_{f f}^{g} \otimes \mathbf{K}_{o o}+\hat{\sigma}_{f f}^{e} \otimes \mathbf{I}_{n_{o}} \\
\hat{\mathbf{g}}_{f o}^{(u n i)} & =\left(\hat{\sigma}_{f f}^{g} \otimes \mathbf{K}_{o o}\right) \hat{\mathbf{V}}^{-1}\left(\mathbf{y}_{f o}-\mathbf{X}_{o} \hat{\boldsymbol{\beta}}_{f}\right) \\
\hat{\mathbf{g}}_{f t}^{(u n i)} & =\mathbb{E}\left(\mathbf{g}_{f t} \mid \mathbf{y}_{f o}\right) \\
& =\left(\hat{\sigma}_{f f}^{g} \otimes \mathbf{K}_{t o}\right) \hat{\mathbf{V}}^{-1}\left(\mathbf{y}_{f o}-\mathbf{X}_{o} \hat{\boldsymbol{\beta}}_{f}\right) \\
& =\mathbf{K}_{t o} \mathbf{K}_{o o}^{-1} \hat{\mathbf{g}}_{f o}^{(u n i)}
\end{aligned}
$$

where $\hat{\mathbf{g}}_{f o}^{(u n i)}$ and $\hat{\mathbf{g}}_{f t}^{(u n i)}$ are the focal trait univariate BLUPs for the training and test set. Note that covariates can be included in the term $\mathbf{X}_{o} \hat{\boldsymbol{\beta}}_{f}$. Also note that as $\hat{\sigma}_{f f}^{g}$ and $\hat{\sigma}_{f f}^{e}$ are scalars, $\hat{\mathbf{V}}=\hat{\sigma}_{f f}^{g} \mathbf{K}_{o o}+\hat{\sigma}_{f f}^{e} \mathbf{I}_{n_{o}}$.

In the multivariate CV1 scenario where secondary features are only available for the training set, predictions can be obtained using:

$$
\begin{aligned}
\hat{\mathbf{V}} & =\hat{\boldsymbol{\Sigma}}^{g} \otimes \mathbf{K}_{o o}+\hat{\boldsymbol{\Sigma}}^{e} \otimes \mathbf{I}_{n_{o}} \\
\hat{\mathbf{g}}_{f o}^{(C V 1)} & =\left(\hat{\boldsymbol{\sigma}}_{f}^{g} \otimes \mathbf{K}_{o o}\right) \hat{\mathbf{V}}^{-1} \operatorname{vec}\left(\mathbf{Y}_{. o}-\mathbf{X}_{o} \hat{\boldsymbol{\beta}}\right) \\
\hat{\mathbf{g}}_{f t}^{(C V 1)} & =\mathbb{E}\left(\mathbf{g}_{f t} \mid \mathbf{Y}_{. o}\right) \\
& =\left(\hat{\boldsymbol{\sigma}}_{f}^{g} \otimes \mathbf{K}_{t o}\right) \hat{\mathbf{V}}^{-1} \operatorname{vec}\left(\hat{\mathbf{Y}}_{. o}-\mathbf{X}_{o} \hat{\boldsymbol{\beta}}\right) \\
& =\mathbf{K}_{t o} \mathbf{K}_{o o}^{-1} \hat{\mathbf{g}}_{f o}^{(C V 1)}
\end{aligned}
$$

where $\mathbf{Y}_{. o}-\mathbf{X}_{o} \hat{\boldsymbol{\beta}}$ is vectorized. Expression (S2) can be evaluated using a fast algorithm that decreases the time complexity for the calculation of the focal trait training set BLUPs $\hat{\mathbf{g}}_{f o}^{(C V 1)}$ from $O\left(n_{o}^{3} p^{3}\right)$ to $O\left(n_{o} p^{2}+p^{3}\right)$ by avoiding the naive inversion of $\hat{\mathbf{V}}[\mathrm{S} 5]$.

The CV2 multivariate predictions can be obtained directly [S2] or through a two-step approach [S9]. We prefer the two-step approach because the fast algorithm can be used to obtain all CV1 training set BLUPs, $\hat{\mathbf{G}}_{. o}^{(C V 1)}$ :

$$
\begin{aligned}
\hat{\mathbf{V}} & =\hat{\boldsymbol{\Sigma}}^{g} \otimes \mathbf{K}_{o o}+\hat{\boldsymbol{\Sigma}}^{e} \otimes \mathbf{I}_{n_{o}} \\
\hat{\mathbf{G}}_{. o}^{(C V 1)} & =\operatorname{vec}^{-1}\left[\left(\hat{\boldsymbol{\Sigma}}^{g} \otimes \mathbf{K}_{o o}\right) \hat{\mathbf{V}}^{-1} \operatorname{vec}\left(\mathbf{Y}_{. o}-\mathbf{X}_{o} \hat{\boldsymbol{\beta}}\right)\right]
\end{aligned}
$$

We then convert these training set BLUPs to intermediate CV1 test set BLUPs and combine those with the observed secondary features for the test set to finally obtain CV2 BLUPs for the test set focal trait:

$$
\begin{aligned}
\hat{\mathbf{V}} & =\hat{\boldsymbol{\Sigma}}_{s s}^{g} \otimes \mathbf{K}_{t t}^{-1}+\hat{\boldsymbol{\Sigma}}_{s s}^{e} \otimes \mathbf{I}_{n_{t}} \\
\hat{\mathbf{g}}_{f t}^{(C V 2)} & =\mathbb{E}\left(\mathbf{g}_{f t} \mid \mathbf{Y}_{s t}, \mathbf{Y}_{. o}\right) \\
& =\mathbf{K}_{t o} \mathbf{K}_{o o}^{-1} \hat{\mathbf{g}}_{f o}^{(C V 1)}+\left(\hat{\boldsymbol{\sigma}}_{f s}^{g} \otimes \mathbf{K}_{t t}^{-1}\right) \hat{\mathbf{V}}^{-1} \operatorname{vec}\left(\mathbf{Y}_{s t}-\mathbf{K}_{t o} \mathbf{K}_{o o}^{-1} \hat{\mathbf{G}}_{s o}^{(C V 1)}\right)
\end{aligned}
$$

In all cases, $\boldsymbol{\Sigma}^{g}$ and $\boldsymbol{\Sigma}^{e}$ must be estimated from the data.
